export default {
  'css': `stats .ui.grid,[is="stats"] .ui.grid{ margin-top: 0; } stats .ui.segments > .segment,[is="stats"] .ui.segments > .segment{ padding: 1.2rem 1rem; }`,

  'exports': {
    progressBars: [
        { name: "Team A", value: 70 },
        { name: "Team B", value: 30 },
        { name: "Team C", value: 20 },
        { name: "Team D", value: 60 },
        { name: "Team E", value: 100 }
    ],

    ratings: {
        total: 500,
        max: 5,
        scores: [
            { rate: 5, score: 151 },
            { rate: 4, score: 89 },
            { rate: 3, score: 63 },
            { rate: 2, score: 71 },
            { rate: 1, score: 126 }
        ]
    }
  },

  'template': function(template, expressionTypes, bindingTypes, getComponent) {
    return template(
      '<h2 class="ui teal tag label">Stats Page</h2><div class="ui two column stackable grid"><div class="column"><div class="ui raised segments"><div expr2="expr2" class="ui segment"></div></div></div><div class="column"><div class="ui raised segments"><div expr5="expr5" class="ui segment"></div></div><div class="ui raised segments"><div expr8="expr8" class="ui segment"></div></div></div></div>',
      [{
        'type': bindingTypes.EACH,
        'getKey': null,
        'condition': null,

        'template': template(
          '<p expr3="expr3"> </p><div><su-progress expr4="expr4" class="indicating" name="progress"></su-progress></div>',
          [{
            'redundantAttribute': 'expr3',
            'selector': '[expr3]',

            'expressions': [{
              'type': expressionTypes.TEXT,
              'childNodeIndex': 0,

              'evaluate': function(scope) {
                return scope.bar.name;
              }
            }]
          }, {
            'type': bindingTypes.TAG,
            'getComponent': getComponent,

            'evaluate': function(scope) {
              return 'su-progress';
            },

            'slots': [{
              'id': 'default',
              'html': 'Completed ',
              'bindings': []
            }],

            'attributes': [{
              'type': expressionTypes.ATTRIBUTE,
              'name': 'value',

              'evaluate': function(scope) {
                return scope.bar.value;
              }
            }],

            'redundantAttribute': 'expr4',
            'selector': '[expr4]'
          }]
        ),

        'redundantAttribute': 'expr2',
        'selector': '[expr2]',
        'itemName': 'bar',
        'indexName': null,

        'evaluate': function(scope) {
          return scope.progressBars;
        }
      }, {
        'type': bindingTypes.EACH,
        'getKey': null,
        'condition': null,

        'template': template(
          '<div expr6="expr6" class="ui horizontal large label"> </div><su-rating expr7="expr7" class="star"></su-rating>',
          [{
            'redundantAttribute': 'expr6',
            'selector': '[expr6]',

            'expressions': [{
              'type': expressionTypes.TEXT,
              'childNodeIndex': 0,

              'evaluate': function(scope) {
                return [scope.rating.score, '/', scope.ratings.total, ':'].join('');
              }
            }]
          }, {
            'type': bindingTypes.TAG,
            'getComponent': getComponent,

            'evaluate': function(scope) {
              return 'su-rating';
            },

            'slots': [],

            'attributes': [{
              'type': expressionTypes.ATTRIBUTE,
              'name': 'value',

              'evaluate': function(scope) {
                return scope.rating.rate;
              }
            }, {
              'type': expressionTypes.ATTRIBUTE,
              'name': 'max',

              'evaluate': function(scope) {
                return scope.ratings.max;
              }
            }],

            'redundantAttribute': 'expr7',
            'selector': '[expr7]'
          }]
        ),

        'redundantAttribute': 'expr5',
        'selector': '[expr5]',
        'itemName': 'rating',
        'indexName': null,

        'evaluate': function(scope) {
          return scope.ratings.scores;
        }
      }, {
        'type': bindingTypes.EACH,
        'getKey': null,
        'condition': null,

        'template': template(
          '<div expr9="expr9" class="ui horizontal large label"> </div><su-rating expr10="expr10" class="heart"></su-rating>',
          [{
            'redundantAttribute': 'expr9',
            'selector': '[expr9]',

            'expressions': [{
              'type': expressionTypes.TEXT,
              'childNodeIndex': 0,

              'evaluate': function(scope) {
                return [scope.rating.score, '/', scope.ratings.total, ':'].join('');
              }
            }]
          }, {
            'type': bindingTypes.TAG,
            'getComponent': getComponent,

            'evaluate': function(scope) {
              return 'su-rating';
            },

            'slots': [],

            'attributes': [{
              'type': expressionTypes.ATTRIBUTE,
              'name': 'value',

              'evaluate': function(scope) {
                return scope.rating.rate;
              }
            }, {
              'type': expressionTypes.ATTRIBUTE,
              'name': 'max',

              'evaluate': function(scope) {
                return scope.ratings.max;
              }
            }],

            'redundantAttribute': 'expr10',
            'selector': '[expr10]'
          }]
        ),

        'redundantAttribute': 'expr8',
        'selector': '[expr8]',
        'itemName': 'rating',
        'indexName': null,

        'evaluate': function(scope) {
          return scope.ratings.scores;
        }
      }]
    );
  },

  'name': 'stats'
};
